def predict(input: pd.DataFrame):
    # Load the model
    model = tf.keras.models.load_model('app\ml_model\cnn_model.h5')
    input_data = input.values
    input_data_reshaped = input_data.reshape((1, input_data.shape[1], 1))

    # Make prediction
    prediction = model.predict(input_data_reshaped)
    
    return float(prediction[0][0])

def predict_arrival_time(input: PredictionInput):
    preprocessed_input = preprocess_input(input)
    time_to_arrival = predict(preprocessed_input)
    return time_to_arrival
